import React, { useState, useEffect } from 'react';
import { jobAPI } from '../services/api';

const MatchResults = ({ jobId, jobTitle }) => {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(false);

  const loadMatches = async () => {
    try {
      const response = await jobAPI.getMatches(jobId);
      setMatches(response.data);
    } catch (error) {
      console.error('Error loading matches:', error);
    }
  };

  const runMatching = async () => {
    setLoading(true);
    try {
      await jobAPI.matchResumes(jobId);
      await loadMatches();
    } catch (error) {
      console.error('Error running matches:', error);
    }
    setLoading(false);
  };

  useEffect(() => {
    if (jobId) loadMatches();
  }, [jobId]);

  const getScoreColor = (score) => {
    if (score >= 80) return 'var(--success-color)';
    if (score >= 60) return 'var(--warning-color)';
    return 'var(--danger-color)';
  };

  const getScoreLabel = (score) => {
    if (score >= 80) return 'Excellent Match';
    if (score >= 60) return 'Good Match';
    return 'Needs Review';
  };

  return (
    <div className="card-custom">
      <div className="card-header-custom flex items-center justify-between">
        <h2 className="section-title" style={{ margin: 0 }}>üéØ Match Results: {jobTitle}</h2>
        <button
          onClick={runMatching}
          disabled={loading || !jobId}
          className="btn-primary-custom"
        >
          {loading ? 'ü§ñ AI Analyzing...' : 'üöÄ Run AI Matching'}
        </button>
      </div>
      <div className="card-body-custom">
        {matches.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">üîç</div>
            <h3 style={{ marginBottom: 'var(--spacing-sm)' }}>No matches found yet</h3>
            <p>Click "Run AI Matching" to analyze candidate resumes against this job posting.</p>
          </div>
        ) : (
          <>
            <div className="grid-3 mb-lg">
              <div className="stat-card">
                <div className="stat-number">{matches.length}</div>
                <div className="stat-label">Total Candidates</div>
              </div>
              <div className="stat-card" style={{ borderLeft: '4px solid var(--success-color)' }}>
                <div className="stat-number" style={{ color: 'var(--success-color)' }}>
                  {matches.filter(m => m.score >= 80).length}
                </div>
                <div className="stat-label">Excellent Matches</div>
              </div>
              <div className="stat-card" style={{ borderLeft: '4px solid var(--warning-color)' }}>
                <div className="stat-number" style={{ color: 'var(--warning-color)' }}>
                  {matches.filter(m => m.score >= 60 && m.score < 80).length}
                </div>
                <div className="stat-label">Good Matches</div>
              </div>
            </div>

            <div style={{ overflowX: 'auto' }}>
              <table style={{ width: '100%', borderCollapse: 'collapse' }}>
                <thead>
                  <tr style={{ backgroundColor: 'var(--bg-tertiary)' }}>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Rank</th>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Candidate</th>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Contact</th>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Match Score</th>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Skills</th>
                    <th style={{ padding: 'var(--spacing-sm)', textAlign: 'left', fontWeight: '600' }}>Date</th>
                  </tr>
                </thead>
                <tbody>
                  {matches.map((match, index) => (
                    <tr key={match._id} style={{
                      borderBottom: '1px solid var(--border-color)',
                      backgroundColor: index < 3 ? 'var(--bg-tertiary)' : 'transparent'
                    }}>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <span className={`badge-custom ${
                          index === 0 ? 'badge-warning' : 
                          index === 1 ? 'badge-secondary' : 
                          index === 2 ? 'badge-secondary' : 'badge-secondary'
                        }`}>
                          #{index + 1}
                        </span>
                      </td>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <div>
                          <div style={{ fontWeight: '600', marginBottom: '4px' }}>
                            {match.resumeId.candidateName}
                          </div>
                          <div style={{ fontSize: '0.875rem', color: 'var(--text-muted)' }}>
                            {match.resumeId.education}
                          </div>
                        </div>
                      </td>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <div style={{ fontSize: '0.875rem' }}>
                          <div>{match.resumeId.email}</div>
                          <div style={{ color: 'var(--text-muted)' }}>{match.resumeId.phone}</div>
                        </div>
                      </td>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <div>
                          <span className="badge-custom" style={{
                            backgroundColor: getScoreColor(match.score),
                            color: 'white',
                            fontSize: '1rem',
                            marginBottom: '4px'
                          }}>
                            {match.score}%
                          </span>
                          <div style={{ fontSize: '0.75rem', color: 'var(--text-muted)' }}>
                            {getScoreLabel(match.score)}
                          </div>
                          <div style={{
                            width: '100px',
                            height: '4px',
                            backgroundColor: 'var(--bg-tertiary)',
                            borderRadius: '2px',
                            marginTop: '4px',
                            overflow: 'hidden'
                          }}>
                            <div style={{
                              width: `${match.score}%`,
                              height: '100%',
                              backgroundColor: getScoreColor(match.score),
                              transition: 'width 0.3s ease'
                            }} />
                          </div>
                        </div>
                      </td>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <div style={{ display: 'flex', flexWrap: 'wrap', gap: '4px' }}>
                          {match.matchingSkills.slice(0, 3).map((skill, idx) => (
                            <span key={idx} className="badge-custom badge-primary" style={{ fontSize: '0.75rem' }}>
                              {skill}
                            </span>
                          ))}
                          {match.matchingSkills.length > 3 && (
                            <span className="badge-custom badge-secondary" style={{ fontSize: '0.75rem' }}>
                              +{match.matchingSkills.length - 3}
                            </span>
                          )}
                        </div>
                      </td>
                      <td style={{ padding: 'var(--spacing-sm)' }}>
                        <div style={{ fontSize: '0.875rem', color: 'var(--text-muted)' }}>
                          {new Date(match.resumeId.uploadedAt).toLocaleDateString()}
                        </div>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default MatchResults;
